import React from 'react';

const AccountManagementPage = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col">
          <div className="card">
            <div className="card-body">
              <h1 className="card-title">Account Management</h1>
            </div>
          </div>
        </div>
      </div>
      <div className="row">
        <div className="col">
          {/* Your content here */}
        </div>
      </div>
    </div>
  );
};

export default AccountManagementPage;
